        setName(e.target.value);
    }
    const [age,setAge] = useState('')
    const handleage = (e) => {
        setName(e.target.value);
    }
    const [email,setEmail] = useState('')
    const handlemail = (e) => {
        setName(e.target.value);
    }
    return (
        <form>
        <label className="label">Name</label>
        <input onChange={handlename} className="input" type="text" value={name}></input>
        <label className="label">Age</label>
        <input onChange={handleage} className="input" type="number" value={age}></input>
        <label className="label">Email</label>
        <input onChange={handlemail} className="input" type="email" value={email}></input>
        </form>
    );
}

export default Form;
